import CompanyBio from './CompanyBio'
import Home from './Home'
import { Route, Link } from 'react-router-dom'

function App() {
  return (
    <div className='App'>
      <Route exact path="/" component={Home} />
      <Route exact path="/bio" component={CompanyBio} />      
    </div>



  );
}

export default App;
